import styled from 'styled-components';

export const Container = styled.div`  * {
  .etapa{

    .imagem{
      opacity: 0.3;
      width: 488px;
height: 386px;

    }
  }
  .sub-titulo{
    font-family: 'Roboto';
    font-style: normal;
    font-weight: bold;
    color: #FFFFFF;
    text-align:center;

  }
  .mensagem{
    font-family: 'Roboto';
    font-style: normal;
    font-weight: bold;
    text-align: center;
    color: #DADADA;
    text-align:center;
  }
}


`;
